import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import Chatbot from '../Chatbot';


function TryBeanhub() {
  return (
    <>
    <h1 className='trybeanhub'>TRY BEANHUB</h1>;
    <Chatbot />
    <Footer />
    </>
  );
}

export default TryBeanhub;
